  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Trempealeau NWR
  outlines Refuge accomplishments from November, 1940 through January, 1941. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, upland game birds, big game animals, and furbearers-
  is also covered. The Refuge development and maintenance section discusses physical
  developments. The public relations section of the report describes recreational
  uses, Refuge visitors, and violations.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
